  gsl_spline_free(spline);
  gsl_interp_accel_free(acc);
  /* Andrea and I have different sign conventions, so I need to put a minus sign in front */
  coeffs->b1 = - coeffs->b1;
  coeffs->b2 = - coeffs->b2;

  REAL8 dM  = sqrt( 1.0 - 4.0 * eta );
  REAL8 chi = a / ( 1.0 - 2.0 * eta );
  REAL8 chiAmax, chiAmed, chiAmin;
  REAL8 cmax, cmed, cmin;
  REAL8 nqcmax, nqcmed, nqcmin;
  EOBNonQCCoeffs chiAmaxCoeffs;
