  XLALSimIMRGetEOBCalibratedSpinNQCv2chiAmed( &chiAmedCoeffs, l, m, eta, a );
  XLALSimIMRGetEOBCalibratedSpinNQCv2chiAmin( &chiAminCoeffs, l, m, eta, a );

