/*coeffs->a3S = 2278.91726941;
coeffs->a4 = -7128.39166422;
coeffs->a5 = 5583.15077297;*/

  nqcmax = chiAmaxCoeffs.b3;
  nqcmed = chiAmedCoeffs.b3;
  nqcmin = chiAminCoeffs.b3;
  coeffs->b3  = cmax*nqcmax + cmed*nqcmed + cmin*nqcmin;
